import React from "react";
//import { withRouter } from 'react-router-dom';
import { Nav, Navbar, Link, NavDropdown, Button, Form, FormControl, NavItem } from 'react-bootstrap'

import "../navigation/navigation.css";
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'

export class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Navbar className="navbar navbar-inverse menu-background sht-navbar">
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <NavItem href='/default'>Home</NavItem>
            <NavItem href='/chemical-area-ledger'>Chemical Area Ledger</NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    )
  }
}
